import React, {useState} from 'react'
import './MyInfo.css'

function EmployeeTableRow({attr, content}){
    if (content === null){
        return ( <tr>
            <td colSpan={2}><h3>나의 정보</h3></td>
        </tr>);
    }
}


export default function MyInfo({employee}) {
    return (
        <div className={'info'}>
            <table>
                <tr>
                    <td colSpan={2}><h3>나의 정보</h3></td>
                </tr>
                <tr>
                    <td>이름</td>
                    <td>{employee.name}</td>
                </tr>
                <tr>
                    <td>성별</td>
                    <td>{employee.gender === 0 ? '남' : '여'}</td>
                </tr>
                <tr>
                    <td>부서</td>
                    <td>{employee.department}</td>
                </tr>
            </table>
        </div>
    );
}
